import React from 'react'
import { Button, TextField } from '@material-ui/core'
import { ContainerPrincial, ContainerInput } from './styled'

const SignupPage = () => {

    return (

        <ContainerPrincial>
            <h1>Cadastre-se</h1>

            <ContainerInput>

            <inp
               
                />

                <TextField 
                    name={"name"}
                    label={"Nome"}
                    variant={"standard"}
                    fullWidth
                    margin={'dense'}
                    required
                    type={"text"}   
                /> 

            <TextField
                name={"name"}
                label={"Email"}
                variant={"standard"}
                fullWidth
                margin={'dense'}
                required
                type={"text"}
            /> 

            <TextField
                name={"name"}
                label={"Senha"}
                variant={"standard"}
                fullWidth
                margin={"dense"}
                required
                type={"text"}
            /> 
            </ContainerInput>

            <Button 
                variant="contained" 
                color="primary">
                Enviar 
            </Button>

        </ContainerPrincial>
    )
}

export default SignupPage
